function Project(props) {

    return (
      <main>
          {props.challenges.map((challenge, index) => (
            <div>
              <li key={index}>{challenge.title}</li>
              <a key={index}>{challenge.deployedURL}</a>
              <a key={index}>{challenge.repo}</a>
              <img></img>
            </div>
          ))}
      </main>
    )
  }

  export default Project;
